import React, { createContext, useContext, useState, useEffect, useCallback } from 'react';
import { authService } from '../services/authService';
import { cookieUtils } from '../utils/cookieUtils';

const AuthContext = createContext();

export const useAuth = () => {
  const context = useContext(AuthContext);
  if (!context) {
    throw new Error('useAuth must be used within an AuthProvider');
  }
  return context;
};

export const AuthProvider = ({ children }) => {
  const [user, setUser] = useState(null);
  const [loading, setLoading] = useState(true);
  const [isAuthenticated, setIsAuthenticated] = useState(false);

  const initializeAuth = useCallback(async () => {
    console.log('üîç AuthContext: Starting authentication initialization');

    try {
      // Debug all cookies first
      cookieUtils.debugCookies();

      const token = cookieUtils.getToken();
      const userData = cookieUtils.getUser();

      console.log('üì¶ Auth data check:', { 
        hasToken: !!token, 
        hasUserData: !!userData,
        tokenLength: token ? token.length : 0,
        userDataKeys: userData ? Object.keys(userData) : []
      });

      if (token && userData) {
        console.log('‚úÖ AuthContext: Found auth data in cookies, setting authenticated state');

        // Set token in API headers
        authService.setAuthToken(token);

        // Set state immediately
        setUser(userData);
        setIsAuthenticated(true);

        console.log('‚úÖ AuthContext: User authenticated from cookies:', userData);

      } else {
        console.log('‚ùå AuthContext: No valid auth data found in cookies');
        setUser(null);
        setIsAuthenticated(false);
      }
    } catch (error) {
      console.error('‚ùå AuthContext: Error initializing auth:', error);
      setUser(null);
      setIsAuthenticated(false);
    }

    console.log('üîÑ AuthContext: Setting loading to false');
    setLoading(false);
  }, []);

  useEffect(() => {
    console.log('üîÑ AuthProvider: Component mounted, initializing authentication');
    initializeAuth();
  }, [initializeAuth]);

  const login = async (credentials) => {
    console.log('üîê AuthContext: Login attempt started');

    try {
      const response = await authService.login(credentials);
      console.log('‚úÖ Login API Response - Full Structure:', response);
      console.log('‚úÖ Response.data:', response.data);
      console.log('‚úÖ Response.data type:', typeof response.data);
      console.log('‚úÖ Response.data keys:', Object.keys(response.data));

      // Check different possible response structures
      let token, userData;

      // Structure 1: Direct in response.data
      if (response.data.token && response.data.user) {
        console.log('üìù Using structure 1: token and user in response.data');
        token = response.data.token;
        userData = response.data.user;
      }
      // Structure 2: Nested in response.data.data
      else if (response.data.data && response.data.data.token && response.data.data.user) {
        console.log('üìù Using structure 2: token and user in response.data.data');
        token = response.data.data.token;
        userData = response.data.data.user;
      }
      // Structure 3: Different field names
      else if (response.data.accessToken || response.data.authToken) {
        console.log('üìù Using structure 3: alternative token field names');
        token = response.data.accessToken || response.data.authToken;
        userData = response.data.userData || response.data.user || response.data.data;
      }
      // Structure 4: Check if it's nested differently
      else {
        console.log('üìù Unknown structure, analyzing all fields:');
        console.log('üìù All response.data fields:', response.data);

        // Try to find token-like fields
        for (const key in response.data) {
          const value = response.data[key];
          console.log(`üìù Field "${key}":`, typeof value, value);

          if (typeof value === 'string' && value.length > 20) {
            console.log(`üìù Potential token found in field "${key}"`);
            token = value;
          }

          if (typeof value === 'object' && value !== null && (value.id || value.email || value.name)) {
            console.log(`üìù Potential user object found in field "${key}"`);
            userData = value;
          }
        }
      }

      console.log('üîç Extracted data:', {
        hasToken: !!token,
        tokenPreview: token ? token.substring(0, 20) + '...' : 'None',
        hasUserData: !!userData,
        userData: userData
      });

      if (!token || !userData) {
        console.error('‚ùå Could not extract token or user data from response');
        console.error('‚ùå Full response for debugging:', JSON.stringify(response.data, null, 2));
        return { success: false, message: 'Invalid login response structure' };
      }

      // Store in cookies
      console.log('üç™ Storing auth data in cookies...');
      cookieUtils.setToken(token);
      cookieUtils.setUser(userData);

      // Set token in API headers
      authService.setAuthToken(token);

      // Update state
      setUser(userData);
      setIsAuthenticated(true);

      console.log('‚úÖ Login successful, user authenticated:', userData);

      // Verify cookies were set
      setTimeout(() => {
        const verifyToken = cookieUtils.getToken();
        const verifyUser = cookieUtils.getUser();
        console.log('üîç Post-login cookie verification:', {
          tokenSet: !!verifyToken,
          userSet: !!verifyUser
        });
      }, 100);

      return { success: true, data: { token, user: userData } };
    } catch (error) {
      console.error('‚ùå Login failed:', error);
      return { 
        success: false, 
        message: error.response?.data?.message || 'Login failed' 
      };
    }
  };

  const signup = async (userData) => {
    console.log('üìù AuthContext: Signup attempt started');

    try {
      const response = await authService.signup(userData);
      console.log('‚úÖ Signup API Response:', response.data);
      return { success: true, data: response.data };
    } catch (error) {
      console.error('‚ùå Signup failed:', error);
      return { 
        success: false, 
        message: error.response?.data?.message || 'Signup failed' 
      };
    }
  };

  const logout = () => {
    console.log('üö™ AuthContext: Logout initiated');

    // Clear cookies first
    cookieUtils.clearAuth();

    // Remove token from API headers
    authService.removeAuthToken();

    // Update state
    setUser(null);
    setIsAuthenticated(false);

    // Call logout API (non-blocking)
    authService.logout().catch(error => {
      console.error('‚ùå Logout API call failed:', error);
    });

    console.log('‚úÖ Logout completed');
  };

  const changePassword = async (passwordData) => {
    console.log('üîê AuthContext: Change password attempt started');

    try {
      const response = await authService.changePassword(passwordData);
      console.log('‚úÖ Change password API Response:', response.data);
      return { success: true, data: response.data };
    } catch (error) {
      console.error('‚ùå Change password failed:', error);
      return { 
        success: false, 
        message: error.response?.data?.message || 'Password change failed' 
      };
    }
  };

  const value = {
    user,
    isAuthenticated,
    loading,
    login,
    signup,
    logout,
    changePassword
  };

  console.log('üîÑ AuthContext: Current state:', { 
    isAuthenticated, 
    hasUser: !!user, 
    loading,
    userName: user?.name || 'None'
  });

  return (
    <AuthContext.Provider value={value}>
      {children}
    </AuthContext.Provider>
  );
};
